  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Oklahoma Real Property Asset Report
  is published annually in compliance with the Oklahoma State Government Asset Reduction
  and Cost Savings Program found in Title 62 O.S. u00a7908. The act requires the Office
  of Management and Enterprise Services (OMES) to compile and maintain a comprehensive
  inventory of all real property owned and leased by the state. All data contained
  in this report was self-reported by each state agency, board, commission, or public
  trust having the State of Oklahoma as a beneficiary.</p>n\",\n\t\"license_title\":
